"""#### Key Information in Our AnnData Object
Heres a quick breakdown of the important information contained in the AnnData object:
- **AnnData Structure**
    - **X:** Gene expression matrix (4417 cells  20,348 genes) - **note that we need to run the raw counts through the scVI model**
    - **obs:** Cell-level metadata (4417 observations/cells)
        - Key annotations in the dataset:
            - sample: Donor ID
            - age: Pediatric or adult
            - location: Pontine or thalamic
            - annotation: Cell type or state

#### Preparing the Data for the scVI Model

Next, well prepare our AnnData object to interact with the scVI model. This includes calculating the number of detected counts per cell and making some structural adjustments to ensure compatibility with the model. Additionally, the model requires a batch field, as it was trained on the CELLxGENE Data Corpus with batch conditioning. To proceed, well set the batch field to unassigned for the forward pass through the model.
"""

adata.obs["n_counts"] = adata.X.sum(axis=1)
adata.obs["joinid"] = list(range(adata.n_obs))

# initialize the batch to be unassigned. This could be any dummy value.
adata.obs["batch"] = "unassigned"

adata.obs['disease'] = "diffuse midline glioma" # add a general disease annotation to our data

"""### Calling the scVI Model and Generating Embeddings

To load our model, well use the CELLxGENE Census API to locate and download the trained scVI model. Before making an API call, we can specify the **Census version**.

The CELLxGENE Census is continuously updated, with long-term stable (LTS) releases published every six months. Each LTS release includes an updated version of the scVI model, retrained on newly added data since the previous release. For this tutorial, well set the Census version to the latest LTS release available at the time of writing.
"""

# We previously set this variable with our import statements
print(CENSUS_VERSION)

"""We can retrieve the URI where the model is stored using the get_embedding_metadata_by_name method from the experimental release of the Census."""

